def solve(tuples):
    counts = {}
    for tup in tuples:
        if tup in counts:
            counts[tup] += 1
        else:
            counts[tup] = 1

    occurrences = set()
    for key, value in counts.items():
        if value in occurrences:
            continue
        else:
            occurrences.add(value)

    result = {}
    for key, value in counts.items():
        if value in occurrences:
            result[key] = value

    return result

